"use client";

import { useConnection, useReadContract, useWriteContract, useWaitForTransactionReceipt } from "wagmi";
import { useState, useEffect } from "react";
import Image from "next/image";
import { RETROPUNKS_ABI, RETROPUNKS_CONTRACT } from "@/lib/contracts";
import { TokenData, NFTMetadata, BACKGROUND_NAMES } from "@/types/nft";
import PunkCard from "@/components/PunkCard";

export default function MyPunksPage() {
	const { address, isConnected, chain } = useConnection();
	const [tokens, setTokens] = useState<TokenData[]>([]);
	const [loading, setLoading] = useState(true);
	const [errorMessage, setErrorMessage] = useState<string | null>(null);

	const [selectedToken, setSelectedToken] = useState<TokenData | null>(null);
	const [customizing, setCustomizing] = useState(false);
	const [newBackground, setNewBackground] = useState<number>(0);
	const [newName, setNewName] = useState("");
	const [newBio, setNewBio] = useState("");

	const contractAddress = RETROPUNKS_CONTRACT;

	// Read balanceOf()
	const { data: balance } = useReadContract({
		address: contractAddress,
		abi: RETROPUNKS_ABI,
		functionName: "balanceOf",
		args: address ? [address] : undefined,
		query: {
			enabled: !!address && isConnected,
		},
	});

	// Write functions
	const { mutate: setBackground, data: bgHash } = useWriteContract();
	const { mutate: setName, data: nameHash } = useWriteContract();
	const { mutate: setBio, data: bioHash } = useWriteContract();

	//--- Transaction receipts ---//

	const { isSuccess: bgSuccess } = useWaitForTransactionReceipt({
		hash: bgHash,
	});
	const { isSuccess: nameSuccess } = useWaitForTransactionReceipt({
		hash: nameHash,
	});
	const { isSuccess: bioSuccess } = useWaitForTransactionReceipt({
		hash: bioHash,
	});

	useEffect(() => {
		async function fetchTokens() {
			if (!address || balance === undefined || !isConnected) {
				setLoading(false);
				return;
			}

			setLoading(true);
			setErrorMessage(null);
			const tokenList: TokenData[] = [];

			try {
				// Fetch owned token IDs using Alchemy NFT API

				if (!process.env.NEXT_PUBLIC_API_KEY) throw new Error("Alchemy API key is not configured");

				const alchemyNetworkMap: Record<number, string> = {
					1: "eth-mainnet",
					11155111: "eth-sepolia",
					8453: "base-mainnet",
					84532: "base-sepolia",
				};

				const network = alchemyNetworkMap[chain?.id ?? 11155111] || "eth-sepolia";
				const alchemyUrl = `https://${network}.g.alchemy.com/v2/${process.env.NEXT_PUBLIC_API_KEY}`;

				const alchemyResult = await fetch(`${alchemyUrl}/getNFTs?owner=${address}&contractAddresses[]=${contractAddress.toLowerCase()}`);

				if (!alchemyResult.ok) throw new Error(`Alchemy API responded with status ${alchemyResult.status}`);

				const alchemyData = await alchemyResult.json();

				if (!alchemyData.ownedNfts || !Array.isArray(alchemyData.ownedNfts)) throw new Error("Invalid response format from Alchemy");

				// Extract token IDs (Alchemy returns hex strings)
				const tokenIds = alchemyData.ownedNfts
					.filter((nft: any) => nft.contract.address.toLowerCase() === contractAddress.toLowerCase())
					.map((nft: any) => {
						const hexId = nft.id.tokenId;

						console.log(`Found token ID (hex): ${hexId}`);

						const decimalId = BigInt(hexId).toString();

						return decimalId;
					});

				console.log("All fetched token IDs (as strings):", tokenIds);

				if (tokenIds.length === 0) console.warn("No tokens found for address:", address, "in contract:", contractAddress);

				// Fetch metadata and tokenURI for each owned token
				for (const tokenId of tokenIds) {
					// globalTokenMetadata
					const metaResult = await fetch("/api/read-contract", {
						method: "POST",
						headers: { "Content-Type": "application/json" },
						body: JSON.stringify({
							contractAddress,
							functionName: "globalTokenMetadata",
							args: [tokenId],
							chainId: chain?.id,
						}),
					});

					if (!metaResult.ok) continue;

					const metaData = await metaResult.json();
					if (metaData.error || !metaData.result || !Array.isArray(metaData.result)) continue;

					const metadataResult = {
						tokenIdSeed: Number(BigInt(metaData.result[0])),
						backgroundIndex: Number(BigInt(metaData.result[1])),
						name: metaData.result[2] as string,
						bio: metaData.result[3] as string,
					};

					// tokenURI
					const uriRes = await fetch("/api/read-contract", {
						method: "POST",
						headers: { "Content-Type": "application/json" },
						body: JSON.stringify({
							contractAddress,
							functionName: "tokenURI",
							args: [tokenId],
							chainId: chain?.id ?? 11155111,
						}),
					});

					if (!uriRes.ok) continue;

					const uriData = await uriRes.json();
					const tokenURI = uriData.result as string | undefined;

					let metadata: NFTMetadata | null = null;
					if (tokenURI && tokenURI.startsWith("data:application/json;base64,")) {
						try {
							const base64Data = tokenURI.replace("data:application/json;base64,", "");
							const jsonString = atob(base64Data);
							metadata = JSON.parse(jsonString);
						} catch (parseErr) {
							console.warn(`Failed to decode tokenURI for token ${tokenId.toString()}:`, parseErr);
						}
					}

					tokenList.push({
						tokenId,
						metadata,
						tokenIdSeed: metadataResult.tokenIdSeed,
						backgroundIndex: metadataResult.backgroundIndex,
						customName: metadataResult.name,
						bio: metadataResult.bio,
					});
				}

				setTokens(tokenList);
			} catch (err: any) {
				console.error("Error loading RetroPunks:", err);
				setErrorMessage(err.message?.includes("Alchemy") ? "Failed to fetch owned tokens via Alchemy API. Please check your API key configuration." : "An error occurred while retrieving your RetroPunks. Please try again later.");
			} finally {
				setLoading(false);
			}
		}

		fetchTokens();
	}, [address, balance, contractAddress, isConnected, chain?.id, bgSuccess, nameSuccess, bioSuccess]);

	//--- Customization Handlers ---//

	const handleCustomize = (token: TokenData) => {
		setSelectedToken(token);
		setNewBackground(token.backgroundIndex || 0);
		setNewName(token.customName || "");
		setNewBio(token.bio || "");
		setCustomizing(true);
	};

	const submitBackground = () => {
		if (!selectedToken) return;
		setBackground({
			address: contractAddress,
			abi: RETROPUNKS_ABI,
			functionName: "setTokenBackground",
			args: [selectedToken.tokenId, BigInt(newBackground)],
		});
	};

	const submitName = () => {
		if (!selectedToken) return;
		setName({
			address: contractAddress,
			abi: RETROPUNKS_ABI,
			functionName: "setTokenName",
			args: [selectedToken.tokenId, newName],
		});
	};

	const submitBio = () => {
		if (!selectedToken) return;
		setBio({
			address: contractAddress,
			abi: RETROPUNKS_ABI,
			functionName: "setTokenBio",
			args: [selectedToken.tokenId, newBio],
		});
	};

	//--- Render Logic ---//

	if (!isConnected) {
		return (
			<div className="flex items-center justify-center">
				<div className="text-center">
					<h1 className="font-press text-4xl font-bold mb-6 tracking-tighter uppercase">My RetroPunks</h1>
					<p className="text-gray-400">Please connect your wallet to view your RetroPunks.</p>
				</div>
			</div>
		);
	}

	if (loading) {
		return (
			<div className="min-h-screen flex items-center justify-center py-20 px-4">
				<div className="text-center">
					<div className="animate-spin rounded-full h-12 w-12 border-b-2 border-retro-orange mx-auto mb-4"></div>
					<p className="text-gray-400">Loading your RetroPunks...</p>
				</div>
			</div>
		);
	}

	if (errorMessage) {
		return (
			<div className="min-h-screen flex items-center justify-center py-20 px-4">
				<div className="text-center">
					<h1 className="text-4xl font-bold mb-4">My RetroPunks</h1>
					<p className="text-red-400 mb-6">{errorMessage}</p>
					<button
						className="btn-primary"
						onClick={() => {
							setErrorMessage(null);
							setLoading(true);
						}}>
						Retry
					</button>
				</div>
			</div>
		);
	}

	if (tokens.length === 0) {
		return (
			<div className="min-h-screen flex items-center justify-center py-20 px-4">
				<div className="text-center">
					<h1 className="text-4xl font-bold mb-4">My RetroPunks</h1>
					<p className="text-gray-400 mb-6">You don't own any RetroPunks.</p>
					<button className="btn-primary" onClick={() => (window.location.href = "/")}>
						Go to Home
					</button>
				</div>
			</div>
		);
	}

	return (
		<div className="min-h-screen py-20 px-4">
			<h1 className="text-4xl font-bold mb-8 text-center">My RetroPunks</h1>

			<div className="grid grid-cols-1 sm:grid-cols-2 lg:grid-cols-3 xl:grid-cols-4 gap-6 max-w-7xl mx-auto">
				{tokens.map((token) => (
					<div key={token.tokenId.toString()} className="border border-gray-700 rounded-lg overflow-hidden bg-gray-900">
						{token.metadata?.image ? (
							<Image src={token.metadata.image} alt={`RetroPunk #${token.tokenId}`} width={400} height={400} className="w-full h-auto" />
						) : (
							<div className="w-full h-64 bg-gray-800 flex items-center justify-center">
								<span className="text-gray-500">No image</span>
							</div>
						)}

						<div className="p-4">
							<h3 className="font-bold text-lg">{token.customName || token.metadata?.name || `#${token.tokenId.toString()}`}</h3>

							<p className="text-sm text-gray-400 mt-1">{token.bio || token.metadata?.description || "No bio set"}</p>

							<button onClick={() => handleCustomize(token)} className="mt-4 w-full bg-retro-orange hover:bg-orange-700 text-white font-medium py-2 px-4 rounded transition-colors">
								Customize
							</button>
						</div>
					</div>
				))}
			</div>

			{/* Customization modal (placeholder â€“ expand as needed) */}
			{customizing && selectedToken && (
				<div className="fixed inset-0 bg-black bg-opacity-70 flex items-center justify-center z-50">
					<div className="bg-gray-900 p-8 rounded-lg max-w-lg w-full mx-4">
						<h2 className="text-2xl font-bold mb-6">Customize #{selectedToken.tokenId.toString()}</h2>

						{/* Background selector */}
						<div className="mb-4">
							<label className="block text-sm font-medium mb-2">Background</label>
							<select value={newBackground} onChange={(e) => setNewBackground(Number(e.target.value))} className="w-full bg-gray-800 border border-gray-700 rounded px-3 py-2">
								{BACKGROUND_NAMES.map((name, index) => (
									<option key={index} value={index}>
										{name}
									</option>
								))}
							</select>
						</div>

						{/* Name input */}
						<div className="mb-4">
							<label className="block text-sm font-medium mb-2">Name</label>
							<input type="text" value={newName} onChange={(e) => setNewName(e.target.value)} maxLength={32} className="w-full bg-gray-800 border border-gray-700 rounded px-3 py-2" placeholder="Enter custom name" />
						</div>

						{/* Bio textarea */}
						<div className="mb-6">
							<label className="block text-sm font-medium mb-2">Bio</label>
							<textarea value={newBio} onChange={(e) => setNewBio(e.target.value)} maxLength={160} rows={4} className="w-full bg-gray-800 border border-gray-700 rounded px-3 py-2" placeholder="Tell us about this RetroPunk" />
						</div>

						<div className="flex justify-end gap-4">
							<button onClick={() => setCustomizing(false)} className="px-4 py-2 bg-gray-700 hover:bg-gray-600 rounded">
								Cancel
							</button>
							<button
								onClick={async () => {
									try {
										if (newBackground !== selectedToken.backgroundIndex) await submitBackground();
										if (newName !== selectedToken.customName) await submitName();
										if (newBio !== selectedToken.bio) await submitBio();
										// Wait for all if needed, or show success toast
									} catch (err) {
										console.error("Customization failed:", err);
										// Optionally show error in modal
									} finally {
										setCustomizing(false);
									}
								}}
								className="px-4 py-2 bg-retro-orange hover:bg-orange-700 rounded">
								Save Changes
							</button>
						</div>
					</div>
				</div>
			)}
			<PunkCard tokenId="1" tokenUri="data:application/json;base64,"/>
		</div>
	);
}
